import React from 'react';
import { Typography, Link, makeStyles, Paper, Grid } from '@material-ui/core';
import { Assignment, Email, Phone, Home } from '@material-ui/icons';
import { Fade} from 'react-reveal';


//Using custom styles
const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1,
    },
    paper: {
        padding: theme.spacing(2),
        maxWidth: "100%",
        textAlign: "center",
    }
}));
export default function ContactMe() {

    //Importing Hooks
    const classes = useStyles();

    return (
        <div>
            <h1>
                <Fade bottom cascade> Contact.</Fade>
            </h1>
            <Fade bottom>
                <div className='contact-content'>
                    <h1>
                        Let’s create your next<br></br>
                        <span className='amazing-color'>experience together</span></h1>
                    <p ><Phone />0420719901
                    </p>
                    <Email/> <a href={`mailto:${"marasinipradeep@gmail.com"}`} className='email'>{"marasinipradeep@gmail.com"}

                    </a>
                    <p>
                        <Home /> 4/10 Lurline Av, Gilles Plain South Australia
                            </p>

                </div>
            </Fade>

            <span className='footer'>Made With ❤ by <a href="https://pradeep-marasini.herokuapp.com/">Pradeep Marasini</a></span>
        </div>
    );
}
